import React from 'react';
import Card from './Card';
import categorias from '../categorias.json';
let array = categorias.categorias;

const CardList = () =>{

    return(
        <>
            <h2>Categorias</h2>
            {array.forEach((categoria)=>{
               return<Card info={categoria}/>
            })}
        </>
    )
}

export default CardList;
